import React from 'react';
import { motion } from 'framer-motion';
import { FaLinkedinIn, FaEnvelope } from 'react-icons/fa';

const Contact = () => {
  return (
    <section id="contact" className="py-20 px-6 text-center bg-black text-white">
      <h2 className="text-4xl font-serif text-primary mb-6">Contact</h2>
      <motion.div 
        initial={{ opacity: 0 }} 
        animate={{ opacity: 1 }} 
        transition={{ duration: 1 }}
        className="flex justify-center gap-8"
      >
        <a 
          href="www.linkedin.com/in/satyansh-5036" 
          target="_blank" 
          rel="noopener noreferrer"
          className="text-3xl text-black hover:text-primary transition duration-300"
        >
          <FaLinkedinIn />
        </a>
        <a 
          href="mailto:satyansh.g16@gmail.com" 
          className="text-3xl text-black hover:text-primary transition duration-300"
        >
          <FaEnvelope />
        </a>
      </motion.div>
    </section>
  );
};

export default Contact;
